div.div:
Вероятно, самая часто встречающаяся директива препроцессора - #include.
#include работает максимально просто: он целиком копирует содержимое указанного файла в место указания директивы.
Ex. // файл a.h
void foo();
// файл b.cpp
#include "a.h"
void foo() {
std::cout << "abc" << std::endl;
}
// после препроцессинга: файл, подающийся на вход компилятору
void foo();
void foo() {
std::cout << "abc" << std::endl;
}
